import React from "react";
let views = 10;

function increment() {
  views += 1;
  console.log({views})
}


function decrement() {
  views -= 1;
  console.log({views})
}

function App() {
  return (
    <div className="App">
      <h1>{views}</h1>
      <button onClick={increment}>Increment</button>
      <button onClick={decrement}>Decrement</button>
    </div>
  );
}

export default App;
